INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('38', '2024-07-23 06:08:57', 'Efficiantur ignorant. Animi autem morbi sunt cupiditates inmensae et inanes divitiarum, gloriae, dominationis, libidinosarum etiam voluptatum. Accedunt aegritudines, molestiae, maerores, qui exedunt animos conficiuntque curis hominum non intellegentium nihil dolendum esse animo, quod sit iudicatum. Plerique autem, quod tenere atque servare id, quod his libris quaeritur, qui sit finis, quid extremum, quid.', '2', '2', '91', '2024-01-27 12:44:07', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('39', '2024-10-07 06:40:08', 'Fere labitur. Quamquam utriusque cum multa non probo, tum illud in primis, quod, cum in rerum natura duo quaerenda sint, unum, quae materia sit, ex qua quaeque res efficiatur, alterum, quae vis.', '1', '5', '27', '2024-01-27 12:47:28', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('40', '2024-07-18 08:11:02', 'Quidem, inquit, totum Epicurum paene e philosophorum choro sustulisti. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere.', '1', '2', '10', '2024-01-27 12:51:59', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('41', '2024-09-05 17:01:49', 'De cetero vellem equidem aut ipse.', '0', '4', '23', '2024-01-27 12:59:54', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('42', '2024-06-01 12:38:58', 'Subtilius velint tradere et negent satis esse, quid bonum sit aut quid iudicat, quo aut petat aut fugiat aliquid, praeter voluptatem et dolorem. Ad haec et quae fugiamus refert omnia. Quod quamquam Aristippi.', '2', '9', '79', '2024-01-27 13:06:52', NULL);
