INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('46', '2024-09-29 19:29:11', 'Nec necessariae. Quarum ea ratio est, ut omne, quo offendimur, dolor, doloris omnis privatio recte nominata est voluptas. Ut enim, cum cibo et potione fames sitisque depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in.', '2', '4', '68', '2024-01-27 13:33:41', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('47', '2024-09-13 23:08:54', 'In qua maxime ceterorum philosophorum exultat oratio, reperire exitum potest, nisi derigatur ad voluptatem, voluptas autem est sola, quae nos vocet ad se et Consentinis et Siculis scribere.', '4', '6', '90', '2024-01-27 13:42:30', NULL);
