INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('50', '2024-10-01 20:25:59', 'Omnium rerum occultarum ignoratione sublata et moderatio natura cupiditatum generibusque earum explicatis, et, ut dixi, ad lineam, hunc naturalem esse omnium corporum motum. Deinde ibidem homo acutus, cum.', '2', '10', '71', '2024-01-27 14:04:45', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('51', '2024-05-08 19:24:05', 'Nescius, Brute, cum, quae summis ingeniis exquisitaque doctrina philosophi Graeco sermone tractavissent, ea Latinis litteris mandaremus, fore ut hic noster labor in varias reprehensiones incurreret. Nam quibusdam, et iis servire, qui vel utrisque litteris uti velint.', '1', '1', '11', '2024-01-27 14:13:14', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('52', '2024-04-05 11:29:02', 'Eo libro, quo a nobis philosophia defensa et collaudata est, cum id, quod ipsi statuerunt, non possunt, conficiuntur et angore et.', '1', '5', '71', '2024-01-27 14:22:35', NULL);
