INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('55', '2024-03-04 15:43:20', 'Tradidisse, quae pertinerent ad bene beateque vivendo a Platone disputata sunt, haec explicari non.', '0', '2', '36', '2024-01-27 14:48:07', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('56', '2024-01-30 06:34:39', 'Nec tamen id, cuius causa haec finxerat, assecutus est. Nam si omnes veri erunt, ut Epicuri ratio docet, tum denique poterit aliquid cognosci et percipi. Quos qui tollunt et nihil posse percipi dicunt, ii remotis sensibus ne id ipsum quidem expedire possunt, quod disserunt. Praeterea sublata cognitione et scientia tollitur omnis ratio et vitae degendae et.', '4', '14', '54', '2024-01-27 14:53:33', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('57', '2024-04-19 09:09:58', 'Ego intellegerem, sed quid probarem. Quid igitur est? Inquit; audire enim cupio, quid non probes. Principio, inquam, in physicis, quibus.', '4', '5', '84', '2024-01-27 15:03:05', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('58', '2024-03-08 18:55:05', 'Derigatur ad voluptatem, voluptas autem est sola, quae nos vocet ad se et Consentinis et Siculis scribere. Facete is quidem, sicut alia; sed neque.', '3', '15', '54', '2024-01-27 15:04:48', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('59', '2024-10-30 17:42:48', 'Dolorem, de quibus ante dictum est, sic amicitiam negant posse a voluptate discedere. Nam cum solitudo.', '3', '9', '43', '2024-01-27 15:12:21', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('60', '2024-12-02 05:21:22', 'In sanguinem suum tam crudelis fuisse, nihil ut de omni virtute sit dictum. Sed similia fere dici possunt. Ut enim medicorum scientiam non ipsius artis, sed bonae valetudinis causa probamus, et gubernatoris ars, quia bene navigandi rationem habet, utilitate, non arte laudatur, sic sapientia, quae ars vivendi putanda est, non expeteretur, si nihil efficeret; nunc expetitur.', '3', '19', '12', '2024-01-27 15:13:36', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('61', '2024-05-03 07:39:33', 'Quae recte, quae oblique ferantur, deinde eadem illa atomorum, in quo etiam Democritus haeret, turbulenta concursio hunc mundi ornatum efficere non poterit. Ne illud quidem perspicuum est, maximam.', '0', '8', '69', '2024-01-27 15:19:57', NULL);
