INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('65', '2024-11-23 14:38:32', 'Tum denique poterit aliquid cognosci et percipi. Quos qui tollunt et nihil posse percipi dicunt, ii remotis sensibus ne id ipsum quidem expedire possunt.', '0', '16', '83', '2024-01-27 15:42:39', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('66', '2024-04-02 23:36:45', 'Natura incorrupte atque integre iudicante. Itaque negat opus esse ratione neque disputatione, quam ob rem tandem, inquit, non satisfacit? Te enim iudicem aequum puto, modo quae dicat ille bene noris. Nisi mihi Phaedrum, inquam, tu mentitum aut Zenonem putas, quorum utrumque audivi, cum mihi nihil sane praeter sedulitatem.', '1', '18', '64', '2024-01-27 15:47:09', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('67', '2024-07-29 08:21:51', 'Illa, quae quasi saxum Tantalo semper impendet, tum superstitio, qua qui utuntur, benivolentiam sibi conciliant.', '1', '11', '67', '2024-01-27 15:51:50', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('68', '2024-05-31 16:04:27', 'Solet. Nec vero, ut noster Lucilius, recusabo, quo minus omnes mea legant. Utinam esset ille Persius, Scipio vero et Rutilius multo etiam magis, quod, cuius in animo versatur, numquam sinit eum respirare.', '1', '12', '87', '2024-01-27 16:01:39', NULL);
