INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('72', '2025-01-03 03:21:13', 'Philosophia audeam scribere? Quamquam a te ipso id quidem licebit iis existimare, qui legerint. Nos autem hanc omnem quaestionem de finibus bonorum et malorum fere a nobis sic intelleges eitam, ut ab ipsis, qui eam disciplinam probant, non soleat accuratius.', '1', '20', '5', '2024-01-27 16:22:23', NULL);
