INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('87', '2024-06-02 01:17:17', 'Statim consequi, nisi in voluptatis locum dolor forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas ea, quae audiebamus, conferebamus, neque erat umquam.', '2', '10', '55', '2024-01-27 17:49:30', NULL);
