INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('89', '2024-08-06 09:02:16', 'Naturae finibus contentus sine aegritudine possit et sine metu degendae praesidia firmissima. -- Filium morte multavit. -- Si sine causa, nollem me ab eo dissentiunt, sed certe non probes, eum quem ego arbitror unum vidisse verum maximisque erroribus animos hominum liberavisse et omnia tradidisse, quae pertinerent ad bene.', '3', '2', '45', '2024-01-27 17:57:55', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('90', '2024-12-21 08:54:21', 'Ut eius magnitudinem celeritas, diuturnitatem allevatio consoletur. Ad ea.', '0', '11', '37', '2024-01-27 18:01:38', NULL);
