INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('92', '2024-07-15 08:40:44', 'Praesertim, qui studiose antiqua persequeris, claris et fortibus viris commemorandis.', '2', '20', '6', '2024-01-27 18:11:04', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('93', '2024-05-03 09:50:27', 'Tamquam in extremo, omnesque et metus plena sit, ratio ipsa monet amicitias comparare, quibus partis confirmatur animus et excelsus omni est liber cura et angore, cum et tibi probatus videretur et iis, quos ego posse iudicare.', '0', '17', '65', '2024-01-27 18:13:51', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('94', '2024-10-03 22:35:18', 'Discere maluisset quam illum etiam ipsum dedocere. Sol Democrito magnus videtur, quippe homini erudito in geometriaque perfecto, huic pedalis fortasse; tantum enim esse censet, quantus videtur, vel paulo aut maiorem aut minorem. Ita, quae mutat, ea.', '3', '7', '78', '2024-01-27 18:21:40', NULL);
