INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('96', '2024-09-15 01:01:14', 'Alia ratione compositis, quid est, cur nostri a nostris non legantur? Quamquam, si plane sic verterem Platonem aut Aristotelem, ut verterunt nostri poetae fabulas.', '1', '11', '56', '2024-01-27 18:29:38', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('97', '2024-09-28 09:33:55', 'Spe nihil earum rerum hic tenetur a sapiente delectus, ut.', '2', '17', '8', '2024-01-27 18:35:14', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('98', '2024-11-11 00:26:12', 'Sic laetamur iis, quae et splendide dicta sint neque sint conversa de Graecis? Nam si ea sola voluptas esset, quae quasi delapsa de caelo est ad cognitionem omnium, regula, ad quam omnia iudicia rerum in sensibus ponit, quibus si semel aliquid falsi.', '0', '13', '86', '2024-01-27 18:40:11', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('99', '2024-07-20 16:01:43', 'Oportet in eo, quod semel admissum coerceri reprimique non potest.', '4', '3', '18', '2024-01-27 18:44:54', NULL);
INSERT INTO `comments` (id, timestamp, content, rating, customer_id, product_id, created_at, updated_at) VALUES ('100', '2024-08-27 03:24:01', 'Dices, libenter assentiar. Probabo, inquit, modo ista sis aequitate, quam ostendis. Sed uti oratione perpetua malo quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus est. Primum.', '3', '15', '67', '2024-01-27 18:50:28', NULL);
